import React from "react";
import "./Home.css";

export default function Home() {
 return (
  <div className="home-container">
   <div className="hero">
    <h2 className="welcome-text">
     <span>Welcome</span>
     <span>To</span>
    </h2>

    <h2 className="brand-text">
     <span className="insure">Hemspire</span>
     <span className="care">Insurance</span>
    </h2>

   </div>
  </div>
 );
}
